import React, { FC } from 'react';

import styles from './main.module.scss';

interface MainProps {}

const Main: FC<MainProps> = () => {

  const getPar = () => {
    const salePar = `<p>Sale !</p>`;
    const date = new Date();
    const today = date.getDate();
    if(today === 1){
       return salePar;
    }
  }

  return(
  <main className={styles.Main}>
    <div dangerouslySetInnerHTML={{getPar}} className='iframeDiv'>

    <iframe width="660" height="375" src="https://www.youtube.com/embed/XKVPu3i_3-8" title="YouTube video player" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"></iframe>
    </div>
  </main>
);
}

export default Main;
